import React, { useEffect, useState } from 'react';

function App() {
    const [signals, setSignals] = useState([]);

    useEffect(() => {
        // Fetch stock signals from the backend
        fetch('http://localhost:5001/signals') // Adjust the URL if necessary
            .then(response => response.json())
            .then(data => setSignals(data))
            .catch(error => console.error('Error fetching signals:', error));
    }, []);

    return (
        <div className="App">
            <header>
                <h1>Stock Signal Dashboard</h1>
            </header>
            <main>
                {signals.length > 0 ? (
                    <ul>
                        {signals.map((signal, index) => (
                            <li key={index}>
                                <strong>{signal.stock}</strong>: {signal.signal}
                            </li>
                        ))}
                    </ul>
                ) : (
                    <p>Loading signals...</p>
                )}
            </main>
        </div>
    );
}

export default App;
